function fillChart(n,t,i){var r=document.getElementById(i),u=new Chart(r,{type:"line",data:{labels:n,datasets:[{data:t,steppedLine:!1,pointRadius:0,backgroundColor:"transparent",borderColor:"#8BBB3E",borderWidth:2,pointBackgroundColor:"#FFF09B"}]},options:{scales:{yAxes:[{ticks:{beginAtZero:!1}}],xAxes:[{display:!1}]},legend:{display:!1},tooltips:{mode:"nearest",intersect:!1},events:["click","mousemove"]}})}function getLastHourStats(){$.ajax({url:"/Dashboard/Home/GetLastHourClicksAsync",data:{linkId:linkId},method:"GET",success:function(n){fillChart(n.labels,n.values,"chartHour"+linkId)},error:function(n){console.log(n)}})}function getLastDayStats(){$.ajax({url:"/Dashboard/Home/GetLastDayClicksAsync",data:{linkId:linkId},method:"GET",success:function(n){fillChart(n.labels,n.values,"chartDay"+linkId)},error:function(n){console.log(n)}})}function getLastWeekStats(){$.ajax({url:"/Dashboard/Home/GetLastWeekClicksAsync",data:{linkId:linkId},method:"GET",success:function(n){fillChart(n.labels,n.values,"chartWeek"+linkId)},error:function(n){console.log(n)}})}function getLastMonthStats(){$.ajax({url:"/Dashboard/Home/GetLastMonthClicksAsync",data:{linkId:linkId},method:"GET",success:function(n){fillChart(n.labels,n.values,"chartMonth"+linkId)},error:function(n){console.log(n)}})}function getLastYearStats(){$.ajax({url:"/Dashboard/Home/GetLastYearClicksAsync",data:{linkId:linkId},method:"GET",success:function(n){fillChart(n.labels,n.values,"chartYear"+linkId)},error:function(n){console.log(n)}})}function getMoneyInfo(){let n=$("#money");$.ajax({url:"/Dashboard/Home/GetBalanceAsync",method:"GET",async:!0,success:function(t){n.html(t+"$")},error:function(n){console.log(n.status);console.log(n.statusText)}})}function getGraph(){$("canvas:not(.d-none)").addClass("d-none");let n=$(".div");select===1?(n=$("#chartHour"+linkId),n.attr("data-loaded")==="0"&&getLastHourStats()):select===2?(n=$("#chartDay"+linkId),n.attr("data-loaded")==="0"&&getLastDayStats()):select===3?(n=$("#chartWeek"+linkId),n.attr("data-loaded")==="0"&&getLastWeekStats()):select===4?(n=$("#chartMonth"+linkId),n.attr("data-loaded")==="0"&&getLastMonthStats()):select===5&&(n=$("#chartYear"+linkId),n.attr("data-loaded")==="0"&&getLastYearStats());n.data("loaded",1);n.removeClass("d-none")}function getAllCharts(){getLastHourStats();getLastDayStats();getLastWeekStats();getLastMonthStats();getLastYearStats()}function getChart(n){linkId=n;getGraph()}let select,linkId="";$(document).ready(function(){"use strict";$(".dropdown-item").click(function(){$("#ddText").html($(this).text());$(".dropdown-item").removeClass("active");$(this).addClass("active");select=$(this).data("val");getGraph()});getMoneyInfo();getAllCharts()}());